import React from "react";
import {ContainerNav} from "./carrosselStyle";
import mercado from "../assets/mercado.avif"
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper-bundle.css';

export default function AppMain() {
    const SimpleSwiper = () => {
        return (
          <Swiper spaceBetween={50} slidesPerView={1}>
            <SwiperSlide>
              <div src={mercado}></div>
            </SwiperSlide>
            <SwiperSlide>
              <div>Slide 2</div>
            </SwiperSlide>
            <SwiperSlide>
              <div>Slide 3</div>
            </SwiperSlide>
          </Swiper>
        );
      };

    return (
        <SimpleSwiper></SimpleSwiper>
    );
}
